    "2014-10-28T20:55:08.259686",nt"name": "bathymetry-offshore-of-coal-oil-point-california",nt"isopen":
    false,nt"url": null,nt"notes": "This part of SIM 3302 presents data for
    the bathymetry and shaded-relief maps (see sheets 1, 2, SIM 3302) of the Offshore
    of Coal Oil Point map area, California. The raster data file for the bathymetry
    map is included in "Bathymetry_OffshoreCoalOilPoint.zip." The raster data file
    for the shaded-relief map is included in "BathymetryHS_OffshoreCoalOilPoint.zip."
    Both are accessible from http://pubs.usgs.gov/ds/781/OffshoreCoalOilPoint/data_catalog_OffshoreCoalOilPoint.html.
    The bathymetry and shaded-relief maps of the Offshore of Coal Oil Point map area,
    California, were generated from bathymetry data collected by the U.S. Geological
    Survey (USGS), by California State University, Monterey Bay, Seafloor Mapping Lab
    (CSUMB), and by Fugro Pelagos. Most of the nearshore and shelf areas were mapped
    by the USGS in the summers of 2006, 2007, and 2008, using a combination of 117-kHz
    and 234.5-kHz SEA (AP) Ltd. SWATHplus-M phase-differencing sidescan sonars. A small
    area in the far-eastern nearshore and shelf was mapped by CSUMB in the summer of
    2007, using a 244-kHz Reson 8101 multibeam echosounder. The outer shelf and slope
    were mapped by Fugro Pelagos in 2008, using a combination of 400-kHz Reson 7125,
    240-kHz Reson 8101, and 100-kHz Reson 8111 multibeam echosounders. The nearshore
    bathymetry and coastal topography were also mapped by Fugro Pelagos in 2009 for
    the U.S. Army Corps of Engineers (USACE) Joint Lidar Bathymetry Technical Center
    of Expertise, using the SHOALS-1000T bathymetric-lidar and the Leica ALS60 topographic-lidar
    systems. All of these mapping missions combined to collect bathymetry from the 0-m
    isobath to beyond the 3-nautical-mile limit of California's State Waters.",nt"license_title":
